import React, { useEffect,useState } from "react";
import axios from "axios";

export default function Prueba() {
 const [dos,setDos] = useState("")


  useEffect(()=>{
    const prueba = axios.get("/prueba").then(res=>res.data).then(data=>{
      console.log("estoesdata",data)
      setDos(prueba)
    })

  })

  return (
    <div>
      <h1>dos</h1>
    </div>
  );
}
